import React from "react";

function Listing() {
  fetch("example.json") // JSON 파일 가져오기
    .then((response) => response.json()) // JSON 데이터를 JavaScript 객체로 변환
    .then((data) => {
      // 데이터를 화면에 표시
      const imgElement = document.getElementById("img");
      imgElement.textContent = data.img;

      const propertyTypeElement = document.getElementById("propertyType");
      propertyTypeElement.textContent = data.propertyType;

      const addressElement = document.getElementById("address");
      addressElement.textContent = data.address;

      const priceElement = document.getElementById("price");
      priceElement.textContent = data.price;

      const structureElement = document.getElementById("structure");
      structureElement.textContent = data.structure;

      const optionsElement = document.getElementById("options");
      optionsElement.textContent = data.options;
    })
    .catch((error) => {
      console.error("Error:", error);
    });
}

export default Listing;
